import React from 'react';
import './Home.css';
import AuthenticationStatus from '../auth/AuthenticationStatus';
import User from '../auth/User';
import { Link } from 'react-router-dom';
import { GeneralButton } from '../components/Buttons';
import axios from 'axios';

// Simple POST request with a JSON body using axios
const element = document.querySelector('#post-request .');
const article = { title: 'Axios POST Request Example' };
axios.post('Details', article)
    .then(response => element.innerHTML = response.codename);

export const TEST = () => {
    return (
      <main>
        
        <h1>TEST POST</h1>
        <p>Authentication Status: <AuthenticationStatus /></p>
        <p>User: <User /></p>
        <Link to="/test" method='post'>
          <GeneralButton type='submit' name='action' value='HELLOPOST'>TEST POST</GeneralButton>
        </Link>

      </main>
      
    );
  };
